import { describe, expect, test } from 'vitest';
import { request } from '../../../__tests__/utils';
describe('ua', () => {
    test('ok', async () => {
        const r1 = await request('http://ua.test.whistlejs.com/index.html');
        expect(r1.data.headers).toHaveProperty('user-agent', 'xxx');
        const r2 = await request('https://ua.test.whistlejs.com/index.html');
        expect(r2.data.headers).toHaveProperty('user-agent', 'xxx');
    });
});
